svg.script:
var logo = document.getElementById('logo');

var maxcheck = window.matchMedia('(max-width: 1000px)');

maxcheck.addListener(reflow);

function reflow(mq) {
    if (mq.matches) {
        logo.setAttribute('preserveAspectRatio', 'xMidYMin meet');
        console.log('matches');
    } else {
        logo.setAttribute('preserveAspectRatio', 'xMinYMin meet');
        console.log('matches not');
    }
}
